import React from 'react'
import { ScatterChart,Scatter ,Legend, ZAxis, CartesianGrid, YAxis, XAxis, Tooltip } from 'recharts';


export default class Graph extends React.Component{

    render(){
    let randomColor = '#'+Math.floor(Math.random()*16777215).toString(16) //generate random color
    let shape = ['circle' , 'cross' , 'diamond' , 'square' , 'star' , 'triangle' , 'wye' ]
    let randomShape = Math.floor(Math.random() * shape.length);
    debugger
        return(
            <div>
                <div>
                <ScatterChart
                    width={500}
                    height={400}
                    margin={{
                    top: 20, right: 20, bottom: 20, left: 20,
                    }}>
                    <CartesianGrid />
                    <XAxis type="number" dataKey="x" name="stature" unit="cm" />
                    <YAxis type="number" dataKey="y" name="weight" unit="kg" />
                    <ZAxis type="number" range={[100]} />
                    <Tooltip cursor={{ strokeDasharray: '3 3' }} />
                    <Legend />
                    <Scatter name="A school" data={this.props.data} fill="#8884d8" line shape={randomShape}/>
                </ScatterChart>
                </div>
            </div>
        )
    }
}
